script: |
  super -f text -I q1832.spq | sort > q1832.out

inputs:
  - name: q1832.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( + 49 * - ( col2 ), col1, - + col0, - + col1 / + ( 95 ) - - 92 );
  - name: tab2

outputs:
  - name: q1832.out
    data: |
      46	51	23
      64	77	40
      75	67	58
